import React, {Component} from 'react';

//apihelper functions
import {registerUser, loginUser, verifyUser } from './services/apihelper'

//custom components
import Login from './Components/Users';
import Register from './Components/Users';

class App extends Component {
  constructor(props) {
    super(props);


  }


  render() {
    return (
      <div>
        <div>
            <Register handleSubmit={this.handleRegister} />
            <Login handleSubmit={this.handleLogin} />
          </div>
      </div>
    )
  }
}


export default App;
